<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Inception</title>
    <style>
        body {
            margin: 0;
            padding: 0;
            width: 100%;
            height: 100vh;
            box-sizing: border-box;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        svg {
            width: 100%;
            height: 100%;
        }

        #building-right,
        #building-left {
            animation: falling-buildings 2s linear infinite;
        }

        @keyframes falling-buildings {
            0% {
                transform: translateY(-15%);
            }

            100% {
                transform: translateY(-100%);
            }
        }

        #man {
            animation: man-moving 3s ease-in-out infinite alternate;
        }

        @keyframes man-moving {
            0% {
                transform: translate(1%, 1%);
            }

            50% {
                transform: translate(0%, 0%);
            }

            100% {
                transform: translate(-1%, -1%);
            }
        }

        #right-under-leg {
            transform-origin: 50%;
            animation: right-under-leg-moving 2s ease-in-out infinite alternate;
        }

        @keyframes right-under-leg-moving {
            0% {
                transform: rotate(0deg);
            }

            100% {
                transform: rotate(-10deg);
            }
        }

        #right-fore-leg {
            transform-origin: center 57%;
            animation: right-fore-leg-moving 2s ease-in-out infinite alternate;
        }

        @keyframes right-fore-leg-moving {
            0% {
                transform: rotate(0deg) translate(0%, 0%);
            }

            100% {
                transform: rotate(-30deg) translate(1.5%, -2%);
            }
        }

        #left-under-leg {
            transform-origin: 50%;
            animation: left-under-leg-moving 2.3s ease-in-out infinite alternate;
        }

        @keyframes left-under-leg-moving {
            0% {
                transform: rotate(0deg) translate(0%, 0%);
            }

            100% {
                transform: rotate(-20deg) translate(1%, -1.5%);
            }
        }

        #left-fore-leg {
            transform-origin: center 57%;
            animation: left-fore-leg-moving 2.3s ease-in-out infinite alternate;
        }

        @keyframes left-fore-leg-moving {
            0% {
                transform: rotate(0deg) translate(.2%, 0%);
            }

            100% {
                transform: rotate(20deg) translate(.7%, 9%);
            }
        }

        #right-arm {
            transform-origin: 58%;
            animation: right-arm-moving 2.5s ease-in-out infinite alternate;
        }

        @keyframes right-arm-moving {
            0% {
                transform: rotate(-20deg) translate(4%, -2%);
            }

            100% {
                transform: rotate(90deg) translate(-13%, 5%);
            }
        }

        #right-fore-arm {
            transform-origin: 55%;
            animation: right-fore-arm-moving 2.5s ease-in-out infinite alternate;
        }

        @keyframes right-fore-arm-moving {
            0% {
                transform: rotate(0deg) translate(0%, 0%);
            }

            100% {
                transform: rotate(30deg) translate(-7%, 4%);
            }
        }

        #left-arm {
            transform-origin: 57%;
            animation: left-arm-moving 3s ease-in-out infinite alternate;
        }

        @keyframes left-arm-moving {
            0% {
                transform: rotate(-15deg) translate(2%, 0%);
            }

            100% {
                transform: rotate(10deg) translate(0%, 0%);
            }
        }

        #left-fore-arm {
            transform-origin: 55%;
            animation: left-fore-arm-moving 3s ease-in-out infinite alternate;
        }

        @keyframes left-fore-arm-moving {
            0% {
                transform: rotate(0deg) translate(0%, 0%);
            }

            100% {
                transform: rotate(28deg) translate(-10%, 3%);
            }
        }
    </style>
</head>
